import React from 'react';
import fixed from '../../Functions/fixed';

function Information({ coininf, handleCoinSubmit }) {
  const {
    name, symbol, priceUsd, marketCapUsd, vwap24Hr, supply, maxSupply, volumeUsd24Hr,
    changePercent24Hr,
  } = coininf;

  return (
    <div className="info-page__list">
      <div className="info-page__list-item">
        <div>
          {name}
        </div>
        <div>
          {symbol}
        </div>
      </div>
      <div className="info-page__list-item">
        priceUsd: $
        {fixed(priceUsd)}
      </div>
      <div className="info-page__list-item">
        marketCapUsd: $
        {fixed(marketCapUsd)}
      </div>
      <div className="info-page__list-item">
        vwap24Hr: $
        {fixed(vwap24Hr)}
      </div>
      <div className="info-page__list-item">
        supply: $
        {fixed(supply)}
      </div>
      <div className="info-page__list-item">
        maxSupply: $
        {fixed(maxSupply)}
      </div>
      <div className="info-page__list-item">
        volumeUsd24Hr: $
        {fixed(volumeUsd24Hr)}
      </div>
      <div className="info-page__list-item">
        changePercent24Hr:
        {' '}
        {fixed(changePercent24Hr)}
        %
      </div>
      <div className="info-page__form">
        <input className="info-page__form-input" type="number" />
        <button className="form-button form-button--color--green" onClick={handleCoinSubmit}>Add to basket</button>
      </div>
    </div>
  );
}

export default Information;
